import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the sort filter appear, we first need to perform a search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_term_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_term_entered.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');

    // Wait for the sort dropdown to be visible on the results page
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results_with_sort.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results_with_sort.png'));

    // Apply the 'Price: High to Low' sort filter
    await page.selectOption('#sortSelect', 'price-high');

    // Take a final screenshot after applying the sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sort_applied.png'));

    // Extract the selected value to verify the action
    const selectedSortValue = await page.$eval('#sortSelect', el => el.value);

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter.",
      extractedData: {
        selectedSort: selectedSortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
